import React from 'react';
import s from "./Dialogs.module.css";
import { NavLink } from 'react-router-dom';


const DialogItem = () =>{
    return(
        <div className={s.dialog}><NavLink to="/dialogs/1" activeClassName={s.active}>Matvey</NavLink></div>

    );
}


const Dialogs = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogs_items}>
                <div className={s.dialog}><NavLink to="/dialogs/2" activeClassName={s.active}>Lesha</NavLink></div>
                <div className={s.dialog}><NavLink to="/dialogs/3" activeClassName={s.active}>Artem</NavLink></div>
                <div className={s.dialog}><NavLink to="/dialogs/4" activeClassName={s.active}>Sasha</NavLink></div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi</div>
                <div className={s.message}>How are you</div>
                <div className={s.message}>Yo</div>
            </div>
        </div>
    );
}

export default Dialogs;
